[OSEv3:children]
masters
nodes
etcd
lb

[OSEv3:vars]
deployment_type=openshift-enterprise

# Setup native HA
openshift_master_cluster_method=native

# Set the load-balancer ip as the master ip
openshift_master_cluster_hostname=gg.gg.0.18

# Set the floating ip as the public ip for web console access
openshift_master_cluster_public_hostname=yy.yy.yy.yy

# Allow any user by default
openshift_master_identity_providers=[{'name': 'allow_all', 'login': 'true', 'challenge': 'true', 'kind': 'AllowAllPasswordIdentityProvider'}]

osm_cluster_network_cidr=ff.ff.ff.ff
openshift_portal_net=kk.kk.kk.kk/10

# The size of the per host subnet allocated for pod IPs
# 9 gives us a /23 on each node, ~510 usable
osm_host_subnet_length=9

# Use IPs only instead of DNS
openshift_set_hostname=true
openshift_hostname="{{ ansible_default_ipv4.address }}"
openshift_public_hostname="{{ ansible_default_ipv4.address }}"
openshift_public_ip="{{ ansible_default_ipv4.address }}"

# Increase max_pods on the nodes
openshift_node_kubelet_args={'pods-per-core': ['0'], 'max-pods': ['510']}

# Add multi-tenant sdn
os_sdn_network_plugin_name='redhat/openshift-ovs-multitenant'

# Enable cluster metrics
use_cluster_metrics=true

# disable cockpit installation
osm_use_cockpit=false

# Add the QE registry
oreg_url=registry.ops.openshift.com/openshift3/ose-${component}:${version} 
cli_docker_additional_registries=registry.ops.openshift.com
cli_docker_insecure_registries=registry.ops.openshift.com
openshift_registry_selector='region=infra'
openshift_router_selector='region=infra'
openshift_clock_enabled=true

